There are a few ways to generate Prost code from proto, we will use the prost_build crate in this example. Add the following required crates to Cargo.toml, and then add a build script to generate the following Rust code during compilation: # [dependencies]
bytes = "1.0" # [build-dependencies]
prost-build = "0.7" // src/build.rs
fn main() { // Remove if you already have `protoc` installed in your system. std::env::set_var("PROTOC", protobuf_src::protoc()); prost_build::compile_protos(&["src/greet.proto"], &["src/"]).unwrap();
} To include the generated code, we'll use [tonic::include_proto]. // src/main.rs
#[allow(warnings, clippy::all)]
// ANCHOR: include_proto
mod proto { tonic::include_proto!("greet");
} Then we just need to implement std::convert::TryFrom for converting the protobuf message to equivalent configuration. // src/main.rs
impl TryFrom<proto::Greet> for Config { type Error = ConvertProtoConfigError; fn try_from(p: proto::Greet) -> Result<Self, Self::Error> { Ok(Self { greeting: p.greeting, }) }
} impl From<Config> for proto::Greet { fn from(config: Config) -> Self { Self { greeting: config.greeting, } }
} Now, let's update Greet's StaticFilter implementation to use the two configurations. // src/main.rs
use quilkin::filters::StaticFilter; impl StaticFilter for Greet { const NAME: &'static str = "greet.v1"; type Configuration = Config; type BinaryConfiguration = proto::Greet; fn try_from_config(config: Option<Self::Configuration>) -> Result<Self, CreationError> { Ok(Self { config: Self::ensure_config_exists(config)?, }) }
} That's it! With these changes we have wired up static configuration for our filter. Try it out with the following configuration: # quilkin.yaml
version: v1alpha1
port: 7001
filters:
- name: greet.v1 config: greeting: Hey
endpoints:
- address: 127.0.0.1:4321

